import React from 'react';

const Card = () => {
  return (
  	<div className>
	    <div>
	    	<article class="mw5 center flex bg-white br3 pa3 pa4-ns mv3 ba b--black-10 grow bw2 shadow">
			  <div class="tc">
			    <img alt='robots' src='https://robohash.org/test?size=200x200' class="br-100 h4 w4 dib ba b--black-05 pa2" />
			    <h1 class="f3 mb2">John Doe</h1>
			    <h2 class="f5 fw4 gray mt0">john.doe@gmail.com</h2>
			  </div>
			</article>
	    </div>
  	</div>
  );
}

export default Card;
